import React, { useContext } from 'react'
import { myContext } from '../context/main'

export default function Cart() {
  const {addedItem} = useContext(myContext);
  return (
    <>
      {
        addedItem.map((item)=>{
            return item.id
        })
      }
    </>
  )
}
